	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (28,"<![CDATA[Poslikajmo Slovenijo (Picture Slovenia) - razstava fotografij na prostem]]>","<![CDATA[Kako je videti Slovenija skozi oči ljubiteljskih fotografov? Čudovito. V Parku Tivoli si lahko ogledate&nbsp; fotografije velikega formata iz Ljubljane in regije Osrednja Slovenija ter največje znamenitosti Slovenije, ki so jih posneli ljubiteljski in profesionalni fotografi v okviru natečaja Poslikajmo Slovenijo.&nbsp;]]>","<![CDATA[Fotonatečaj Poslikajmo Slovenijo je namenjen povečanju povečati prepoznavnosti Slovenije v svetu in spodbujanju obiskovalcev, ljubiteljev in prijateljev Slovenije, da s svojimi fotografskimi izdelki sodelujejo pri predstavitvi na&scaron;e države.Nagrajena dela natečaja izbirajo uveljavljeni slovenski fotografi Arne Hodalič, Tomo Jeseničnik in Borut Peterlin ter vodja projekta Picture Slovenia Primož Žižek.Več informacij o natečaju je na voljo na spletni strani Picture Slovenia.]]>","http://www.visitljubljana.com/file/979742/fmpgtmp_bc9ucw.jpeg")');
	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (29,"<![CDATA[Sedanjost in prisotnost - ponovitev 3: Ulica]]>","<![CDATA[Razstava Sedanjost in prisotnost z deli slovenskih in drugih umetnikov iz &scaron;ir&scaron;ega prostora Balkana in vzhodne Evrope, ki so nastajala od 60-tih let prej&scaron;njega stoletja do danes, tematizira koncept sodobnosti in se ukvarja z različnimi oblikami časa.]]>","<![CDATA[V tretjem delu razstave Sedanjost in prisotnost so na ogled dela, ki so nastala v javnem prostoru oziroma natančneje, na ulici. Umetniki iz Vzhodne Evrope, katerih dela muzej hrani v zbirki Arteast 2000, so v času socializma z vsako svojo intervencijo na ulici naredili gesto za demokracijo.&nbsp;Razstavljena so dela naslednjih umetnikov: Čto delat?, Nu&scaron;a in Srečo Dragan, Tomislav Gotovac, Irwin, Milan Kn&iacute;ž&aacute;k, OHO, Dan Perjovschi, Tadej Pogačar &amp; P.A.R.A.S.I.T.E. Muzej sodobne umetnosti, Lotty Rosenfeld, Martina Ruhsam &amp; Vlado Repnik, &Scaron;kart, Endre T&oacute;t, Goran Trbuljak, Želimir Žilnik ter izbor videov iz Arhiva EVR in arhiv Muzeja na cesti.]]>","http://www.visitljubljana.com/file/1047479/fmpgtmp_edrq1w.jpeg")');
	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (30,"<![CDATA[Idrija – zibelka naravoslovja]]>","<![CDATA[Razstava predstavlja izbrane predmete iz zakladnice geolo&scaron;ke dedi&scaron;čine in biotske raznovrstnosti, spoznali evropske in slovenske naravoslovce ter njihovo delo.]]>","<![CDATA[]]>","")');
	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (31,"<![CDATA[Skrivnostna smrt mlade Leonore]]>","<![CDATA[Na razstavi je na ogled okostje samice brazdatega kita, ki so ga leta 2003 odkrili v Piranskem zalivu in ga poimenovali Leonora.]]>","<![CDATA[Največji eksponat, kar jih je Prirodoslovni muzej pridobil v svoji 190 letni zgodovini, sku&scaron;a obiskovalcem z interaktivno postavitvijo približati življenjsko okolje in navade teh največjih sestalcev.]]>","")');
