	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (413,"<![CDATA[Sedanjost in prisotnost - ponovitev 3: Ulica]]>","<![CDATA[Razstava Sedanjost in prisotnost z deli slovenskih in drugih umetnikov iz &scaron;ir&scaron;ega prostora Balkana in vzhodne Evrope, ki so nastajala od 60-tih let prej&scaron;njega stoletja do danes, tematizira koncept sodobnosti in se ukvarja z različnimi oblikami časa.]]>","<![CDATA[V tretjem delu razstave Sedanjost in prisotnost so na ogled dela, ki so nastala v javnem prostoru oziroma natančneje, na ulici. Umetniki iz Vzhodne Evrope, katerih dela muzej hrani v zbirki Arteast 2000, so v času socializma z vsako svojo intervencijo na ulici naredili gesto za demokracijo.&nbsp;Razstavljena so dela naslednjih umetnikov: Čto delat?, Nu&scaron;a in Srečo Dragan, Tomislav Gotovac, Irwin, Milan Kn&iacute;ž&aacute;k, OHO, Dan Perjovschi, Tadej Pogačar &amp; P.A.R.A.S.I.T.E. Muzej sodobne umetnosti, Lotty Rosenfeld, Martina Ruhsam &amp; Vlado Repnik, &Scaron;kart, Endre T&oacute;t, Goran Trbuljak, Želimir Žilnik ter izbor videov iz Arhiva EVR in arhiv Muzeja na cesti.]]>","http://www.visitljubljana.com/file/1047479/fmpgtmp_edrq1w.jpeg")');
	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (414,"<![CDATA[Idrija – zibelka naravoslovja]]>","<![CDATA[Razstava predstavlja izbrane predmete iz zakladnice geolo&scaron;ke dedi&scaron;čine in biotske raznovrstnosti, spoznali evropske in slovenske naravoslovce ter njihovo delo.]]>","<![CDATA[]]>","")');
	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (415,"<![CDATA[Skrivnostna smrt mlade Leonore]]>","<![CDATA[Na razstavi je na ogled okostje samice brazdatega kita, ki so ga leta 2003 odkrili v Piranskem zalivu in ga poimenovali Leonora.]]>","<![CDATA[Največji eksponat, kar jih je Prirodoslovni muzej pridobil v svoji 190 letni zgodovini, sku&scaron;a obiskovalcem z interaktivno postavitvijo približati življenjsko okolje in navade teh največjih sestalcev.]]>","")');
	tx.executeSql('INSERT INTO tmp_event (id,title,intro,description,image) VALUES (416,"<![CDATA[GOTO 1982 - razstava računalnikov in računalniške opreme]]>","<![CDATA[Ob 30. letnici računalnika ZX Spectrum, ki je veljal za enega najbolj popularnih hi&scaron;nih računalnikov osemdesetih let 20. stoletja, je na razstavi o zgodovini računalnikov na ogled več kot 100 računalnikov in druge računalni&scaron;ke opreme od leta 1960 pa do danes.]]>","<![CDATA[]]>","http://www.visitljubljana.com/file/480557/fmpgtmp_jk5mgx.jpeg")');
